story:
['StoryTwo years ago in September 2010, I recorded "Summer's Slumber":






Now on my third attempt at recording and putting these songs together, I think it's about time to show something for it. Recording mix-master Ross Farbe and I got together during a couple thunderstorms over the Summer and put together something that I'm very excited to share, but in order to do that I'll need a little help from you!\xa0In return, you'll get the EP along with my undying gratitude.Anything you're willing to give helps tremendously with funding this release.Since my 1st goal was reached, here's my UPDATED plan:\xa0The more we can raise, the more I'll give to you. My new goal is to raise $200 more ($650 total) for nicer packaging & some bonuses. Let's see how far we can take this thing!Here's the update on what I've done thus far:On October 4th, I released "Feel Bet-r":\xa0F R E E DOWNLOAD
        .soundcloud .card {
          max-height: 250px;
        }
        .soundcloud .embedly-card iframe.embedly-card {
          height: 220px;
        }
        .card iframe[title~=SoundCloud] {
          height: unset;
        }

"Feel Bet-r" is the track that G-Eazy's "Marilyn" is based off of.
Then of course...November 10th @ Allways Lounge: WAKE EP RELEASE PARTY!!!(further event details tba)xoxo,Dominique LeJeune']
